   286→        <h1 id="firstHeading">Semantic immune system</h1>
   287→        <div id="siteSub">From Wikipedia, the free encyclopedia</div>
   288→        <div id="contentSub"><i>Not to be confused with <a href="/wiki/Computational_immunology">computational immunology</a> or <a href="/wiki/Immune_network_theory">immune network theory</a>.</i></div>
   289→
   290→        <table class="ambox">
   291→            <tr>
   292→                <td><b>This article describes a theoretical system designed to protect itself from the processes it is meant to study.</b> Recursive instabilities may occur. <small><i>(January 2026)</i></small></td>
